// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.28;

import "https://github.com/Vectorized/solady/blob/main/src/tokens/ERC20.sol";

contract ConstantOfferRatePool is ERC20 {
    ERC20 public immutable asset;
    string public _name;
    string public _symbol;

    constructor(ERC20 newAsset){
        asset = newAsset;
    }
    
    function name() public view override returns (string memory){
        return string.concat(_name," ETH Pool");
    }
    
    function symbol() public view override returns (string memory){
        return string.concat(_symbol,"ETH");
    }

    function previewDeposit(uint assets) public returns (uint) {}
    function deposit(uint assets,address receiver) payable public returns (uint) {
        previewDeposit(assets);
    }
}

